import{j as t,b as a,c as p,a7 as e}from"./chunks/framework.B0f4rbfy.js";const M=JSON.parse('{"title":"续费了9年域名！","description":"偶然发现域名快到期了，花费261元直接再续9年域名（拉满）","frontmatter":{"tag":"杂记","description":"偶然发现域名快到期了，花费261元直接再续9年域名（拉满）","cover":"https://img.cdn.sugarat.top/mdImg/MTY5MTgzMzg4OTU2NA==691833889564"},"headers":[],"relativePath":"essay/notes/2023-08-12.md","filePath":"essay/notes/2023-08-12.md","lastUpdated":1691834418000}'),s={name:"essay/notes/2023-08-12.md"},r=e('<h1 id="续费了9年域名" tabindex="-1">续费了9年域名！ <a class="header-anchor" href="#续费了9年域名" aria-label="Permalink to &quot;续费了9年域名！&quot;">​</a></h1><h2 id="缘起" tabindex="-1">缘起 <a class="header-anchor" href="#缘起" aria-label="Permalink to &quot;缘起&quot;">​</a></h2><p>听说小程序要备案了，随手打开了一个学生时期开发的一个小程序</p><p><img src="https://img.cdn.sugarat.top/mdImg/MTYxNzYwODI3MDQ4OA==617608270488" alt="" loading="lazy"></p><p>发现用不了，打开就报错了</p><p><img src="https://img.cdn.sugarat.top/mdImg/MTY5MTgzMjk2NzgxOQ==691832967819" alt="" loading="lazy"></p><p>但不清楚是什么原因，看了一下上次部署还是一年前，期间也没迭代过</p><p><img src="https://img.cdn.sugarat.top/mdImg/MTY5MTgzMzA5NDcwNw==691833094707" alt="" loading="lazy"></p><p>然后打开了一下<a href="http://hdkq.sugarat.top/" target="_blank" rel="noreferrer">网页版</a>，控制台看了一下请求是正常响应的</p><p><img src="https://img.cdn.sugarat.top/mdImg/MTY5MTgzMzI4MjQ3NQ==691833282475" alt="" loading="lazy"></p><p>不过细看发现是 http 请求，我大概猜了可能是网站的SSL证书到期了，于是将域名改成https访问，果然G了</p><p><img src="https://img.cdn.sugarat.top/mdImg/MTY5MTgzMzM1MzY3MQ==691833353671" alt="" loading="lazy"></p><p>找了个<a href="https://uutool.cn/ssl-time/" target="_blank" rel="noreferrer">工具网站</a>查了一下到期时间</p><p><img src="https://img.cdn.sugarat.top/mdImg/MTY5MTgzMzQxMjg3Mw==691833412873" alt="" loading="lazy"></p><p>巧了，正好就是前2周</p><p>此时随手打开了阿里云的控制台，准备重新申请一张 SSL 证书</p><p><strong>恰好打开发现域名 明年就到期了，就打开了续费页面，看看涨价没</strong></p><p>发现只要29一年，以前都是1年1年的续费，看着便宜准备直接给它搞个几十年（万一哪天涨价了）</p><p>结果发现拉满最多是108个月刚好是9年(261直接拿下)</p><p><img src="https://img.cdn.sugarat.top/mdImg/MTY5MTgzMzg4OTU2NA==691833889564" alt="" loading="lazy"></p><h2 id="结语" tabindex="-1">结语 <a class="header-anchor" href="#结语" aria-label="Permalink to &quot;结语&quot;">​</a></h2><p>域名这个东西感觉和手机号一样，虽然没特殊意义，但也不舍得随便换 😄</p><p>希望后面能掏个便性价比高时间也长的服务器，现在这个明年也到期了</p><p><img src="https://img.cdn.sugarat.top/mdImg/MTY5MTgzNDM3MjU4MQ==691834372581" alt="" loading="lazy"></p>',24),g=[r];function o(n,i,d,l,m,c){return a(),p("div",null,g)}const _=t(s,[["render",o]]);export{M as __pageData,_ as default};
